// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;

contract IPFSImageStore {

  string[] allImages;
  Report[] reports;
  uint idx;

  struct Report{
    string original_cid;
    string reported_cid;
    int votes;
  }

  struct User {
    string name;
    string lastname;
    string username;
    uint[] indexs;
  }

  mapping(address => User) users;

  mapping(string => int) report;

  constructor() public {
    idx = 0;
  }

  function set(string memory _cid) public {
    allImages.push(_cid);
    users[msg.sender].indexs.push(idx);
    idx++;
  }

  function get() public view returns (string[] memory){
    string[] memory temp = new string[](idx);
    uint idxLength = users[msg.sender].indexs.length;
    uint mem;
    for(uint i = 0; i < idxLength; i++){
      mem = users[msg.sender].indexs[i];
      temp[i] = allImages[mem];
    }
    return temp;
  }

  function getAll() public view returns (string[] memory) {
    return allImages;
  }

  function getUser() public view returns (User memory){
    return users[msg.sender];
  }

  function setUser(string memory _name, string memory _lastname, string memory _username) public {
    users[msg.sender].name = _name;
    users[msg.sender].lastname = _lastname;
    users[msg.sender].username = _username;
  }
}
